const renderIcon = ({ name, ...props }) => {
  switch (name) {
    case 'divany':
      return <DivanyIcon {...props} />;
    case 'krovati':
      return <KrovatiIcon {...props} />;
    case 'shkafy':
      return <ShkafyIcon {...props} />;
    case 'stoly':
      return <StolyIcon {...props} />;
    case 'hranenie':
      return <HranenieIcon {...props} />;
    case 'veshalki':
      return <VeshalkiIcon {...props} />;
    case 'gostinaya':
      return <GostinayaIcon {...props} />;
    case 'spalnya':
      return <SpalnyaIcon {...props} />;
    case 'detskaya':
      return <DetskayaIcon {...props} />;
    case 'prihojaya':
      return <PrihojayaIcon {...props} />;
    case 'kuhnya':
      return <KuhnyaIcon {...props} />;
    case 'vannaya':
      return <VannayaIcon {...props} />;
    case 'kabinet':
      return <KabinetIcon {...props} />;
    case 'ofis':
      return <OfisIcon {...props} />;
    case 'dacha':
      return <DachaIcon {...props} />;
    default:
      return <DivanyIcon {...props} />;
  }
};

function MenuIcon({ name = 'Eye', className = '', ...props }) {
  return renderIcon({ name, className, ...props });
}

export default MenuIcon;
